import React from "react";
import { Route, Redirect } from "react-router-dom";

export const ProtectedRoute = ({
  component: Component,
  ...rest
}) => {
  return (
    <Route
      {...rest}

      render={props => {
        if (props.isLoggedIn) {
          return <Component {...props} />;
        } else {
          return (
            <Redirect
              to={{
                pathname: "/dash",
                state: {
                  from: props.location
                }
              }}
            />
          );
        }
      }}
    />
  );
};
